import { SidebarMenu } from "./components/sidebarMenu";
import './app.scss';
import { Drawer } from "./components/drawer";



function App() {
  return (
    <>
      <Drawer/>

      <Header />
      <BannerSale />

      <div className="main">
        <SidebarMenu />
        <Bestsellers />
      </div>

    </>

  );
}

export default App;
